  [],\n\t\"revision_timestamp\": \"2016-05-25T01:00:16.319358\",\n\t\"name\": \"cafe-corporate-average-fuel-economy-fleet-fuel-economy-performance-report\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NHTSA's Corporate Average Fuel Economy (CAFE)
  program requires manufacturers of passenger cars and light trucks, produced for
  sale in the U.S., to meet CAFE standards, expressed in miles per gallon (mpg). The
  purpose of the CAFE program is to reduce the nation's energy consumption by increasing
  the fuel economy of cars and light trucks.  The CAFE Public Information Center (PIC)
  is the authoritative source for Corporate Average Fuel Economy (CAFE) program data.
  This site allows fuel economy data to be viewed in report and/or graph format. The
  data can be sorted and filtered to produce custom reports which can also be downloaded
  as Excel or pdf files. NHTSA periodically updates the CAFE data in the PIC and,
  therefore, each report and graph is date stamped to indicate the last time NHTSA
  made updates.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
